import React, {Component} from "react";

class TasksFilter extends Component  {
    render() {
        const {label} = this.props
            return (
            <li>
                 <button
                    onClick = {()=>this.props.onAllVision}>
                    {label}
                </button>
             </li>);
    };
};

class TasksFilterClear extends Component {



    render() {
        const {label} = this.props
        return (
            <button
                onClick = {()=>this.props.onClearCompleted()}>
                {label}
            </button>
        );
    };
};

export {
TasksFilter,TasksFilterClear
}
